interface Persona {
    nombreCompleto: string;
    edad: number;
    //Dirección es un objeto que contiene 2 variables en su interior
    direccion: {
        pais: string;
        casaNo: string;
    }
}




export const ObjetosLiterales = () => {

    const persona: Persona = {
        nombreCompleto: 'Diego',
        edad: 24,
        //Dirección es un objeto que contiene 2 variables en su interior
        direccion: {
            pais: 'Chile',
            casaNo: 'Depto 102, torre A'
        }
    }

    return (
        <>
            <h3>Objetos Literales</h3>
            <hr />
            <code>
                <pre>
                    {JSON.stringify(persona, null, 2)}
                </pre>
            </code>
        </>
    )
}
